name: Yummy Eggs
source: Joan Bridges
categories: [breakfast, eggs, christmas, christmas2014]
notes: |
  Cooking time in attached photo of recipe is wrong; it actually takes 45m to an hour to cook.
ingredients: |
  4 eggs
  1 cup milk
  1/2 teaspoon salt
  1 tablespoon butter

directions: |
  Beat eggs until light.
  Add milk and salt.
  Melt butter in double boiler
  Add eggs.
  Cook 45 min to 1 hour
